import React, { useState } from 'react';
import PropTypes from 'prop-types';
import ReactMarkdown from 'react-markdown';
import {render} from 'react-dom';
import gfm from 'remark-gfm';
import './AnnoncesGL.css';




export default function AnnoncesGL() {
    const text = `# Hello World!
    I :heart: remark-emoji
    
    Also Emoticons are supported :-) (if enabled)
    `;

    render(<ReactMarkdown plugins={[gfm]} children={text} />, document.getElementById("AnnoncesGL"))

    return(
        <div className="AnnoncesGL">
            
        </div>
        
    );
}
